import React from 'react';
import styles from './DetailInfo.module.css';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';

export default function Detailinfo() {
  //   AIzaSyApDkK3ksEJAT6v0BTqNW3OeaZJ8NcgxSo
