    {
      name: '명지대학교 제 5공학관',
      time: '연중무휴 24시간 운영',
      location: '경기도 용인시 처인구 명지로 116',
    },
  ];
  const containerStyle = {
    width: '400px',
    height: '400px',
  };
  const center = { lat: 37.2222086, lng: 127.187657 };
  return (
    <div>
      <p className={styles.title}>상호명 : {dummy[0].name}</p>
      <p className={styles.time}>운영시간 : {dummy[0].time}</p>
      <p className={styles.location}>위치 : {dummy[0].location}</p>
      <LoadScript googleMapsApiKey='AIzaSyApDkK3ksEJAT6v0BTqNW3OeaZJ8NcgxSo'>
        <GoogleMap
          className={styles.map}
          mapContainerStyle={containerStyle}
          center={center}
          zoom={20}
        >
          <Marker position={center} />
        </GoogleMap>
      </LoadScript>
    </div>
  );
}
